sys_variable_value.value:
(function execute(inputs, outputs) {
    if (gs.nil(inputs.properties)) {
        outputs.property_value = inputs.default_value;
        return;
    }

    var parsed = JSON.parse(inputs.properties);
    outputs.property_value = parsed[inputs.property_name];
  gs.info("Get Source Property Value------- "+parsed[inputs.property_name]);
    if (gs.nil(outputs.property_value))
        outputs.property_value = inputs.default_value;

  gs.info("Get Source Property Value------- "+outputs.property_value);

})(inputs, outputs);

